import React from 'react';




const MealList = (props) => {
    console.log(props.passMealDetails);


    const RenderMealList = props.passMealDetails.map((each) => {
        return(
            <div key={each.id} style={{display:"flex",justifyContent:"space-between",alignItems:"center",padding:"3%"}}>
                <div align='center'><h1  className='display-5'></h1></div>


            </div>    
        );
    })

    return(
      <div style={{backgroundColor:"lightblue", borderRadius:"15px"}}>
          <h1 className='display-6'>Meal List View</h1>


      </div>
  );
};

export default MealList;
